import React from 'react'
import { Container, Card, Title, Text } from './styles/app.styles'

function App() {
  return (
    < Container >

      <Title> Seja Bem Vindo!, Abra o video e mude sua vida! </Title>
      <Card>
        <video width="400px" controls>
          <source src="./assets/vide/movie_01.mp4" type="video/mp4" />
        </video>
      </Card>

    </Container >
  );
}

export default App;
